import React, { useEffect } from 'react';
import { datadogRum } from '@datadog/browser-rum';

const MyComponent = () => {
  useEffect(() => {
    // Initialize Datadog RUM with your configuration
    datadogRum.init({
      applicationId: 'e1aa6712-47da-4eb5-a4b2-2e77b7c12156',
      clientToken: 'pubfbbbc381458a8ee8a4b4c5f8f4524e95',
      site: 'us5.datadoghq.com',
      service: 'spritle-',
      env: 'Spritle01',
      version: '1.0.0',
      sessionSampleRate: 50, // Adjust as needed
      trackInteractions: true, // Enable/disable user interactions tracking
      // Add any additional configuration options here
    });

    // Optional: Set up automatic view tracking
    // datadogRum.startViewCollection();
  }, []); // Empty dependency array means this effect runs only once, on component mount

  return (
    <div>
      <form action="">
        <input type="button" name="submit"  />
      </form>
    </div>
  );
};

export default MyComponent;
